import React from "react";
import VoiceItem from "../VoiceItem/VoiceItem";

function VoiceList() {
  return (
    <div>
      <VoiceItem name={'100 причин'}/>
      <VoiceItem name={'Хэппи бёздей'}/>
      <VoiceItem name={'Для настроения'}/>
      <VoiceItem name={'Для настроения 2'}/>
    </div>
  )
}

export default VoiceList;
